CREATE DEFINER=`dap`@`%` PROCEDURE `Ranks` (`mSessionID` INT)  BEGIN
DECLARE mPollID int;
DECLARE CountQuestion int;
DECLARE Counter int;
DECLARE mEventID int;
DECLARE totalUserEvent int;
CREATE TEMPORARY TABLE FinalRank
(
UserID int,
TimeStamp varchar(50),
ChoiceID int,
CorrectAnswer int,
PollID int,
Status int,
Score int
);


set CountQuestion = (select count(PollID) as count from tmaspoll where SessionID = mSessionID);
set Counter = 1;
set mEventID = (select EventID From tmassession WHERE SessionID = mSessionID) ;
set totalUserEvent = (select count(*) total From tmasuser WHERE EventID = mEventID);

WHILE (Counter <= CountQuestion+1) DO

	set @RowNumber = 0;
	set mPollID = (select PollID from (select  (@RowNumber:=@RowNumber + 1) AS RowNumber,PollID from tmasPoll where SessionID = mSessionID) as q where RowNumber = Counter);
 
    set @RowNumber2 = 0;
	
	select  us.UserID 
	, pr.Timestamp 
    ,pr.ChoiceID as ChoiceID 
    
    , p.ChoiceID as CorrectAnswer, p.PollID
	 , case when pr.ChoiceID = p.ChoiceID then 1 else 0 end as Status 
      ,CASE WHEN pr.ChoiceID is null THEN totalUserEvent ELSE  (@RowNumber2:=@RowNumber2+1) END AS Score
    from tmasuser us
		LEFT JOIN (SELECT * FROM ttrnpollresponse WHERE PollID = mPollID) pr ON pr.UserID = us.UserID
        LEFT JOIN (SELECT * FROM tmaspoll  WHERE PollID = mPollID) p ON pr.PollID = p.PollID 
    WHERE   us.eventID = mEventID -- and  -- or us.eventID = 27
      order by status desc,Timestamp asc;
    
    
    set Counter = Counter+1;

END WHILE;

select UserID , sum(Score) As Score
from FinalRank
GROUP BY userID
ORDER BY  Score asc ;

DROP TABLE FinalRank;



END$$

CREATE DEFINER=`dap`@`%` PROCEDURE `ViewRank` (IN `mSessionID` INT)  BEGIN
